Nodejs/Mongoose pull objectId from Array doesn't work in ternary expression<p>Am trying to do simple thing, pulling a userId from an array with mongoose on mongo database and updating the object by findByIdAndUpdate method. here i am using the '$pull' '$addToSet' methods like a toggle to add and remove userId from array. in short my goal is to like when cliked and unlike on the second click. so i put the '$pull' and '$addToSet' in ternary expression and used it in the method findByIdAndUpdate() like so:</p>

<pre><code>exports.getLikeCounts = async (req, res) =&gt; {

  const likes = Review({_id: req.params.id}).likes.map(obj =&gt; obj.toString());

  //ternarry expression

  const likeOperator = likes.includes(req.user._id) ? '$pull' : '$addToSet';

  const likeReview = await Review
    .findByIdAndUpdate( {_id: req.params.id},
      {[likeOperator]: {likes: req.user._id}},
      {new: true}
    )
  res.json(likeReview);
}
</code></pre>

<p>In here it only adds but doesn't pull the userId from array on the second click.
i could't understand what am missing any help would be appreciated and thanks.</p>

<p>the structure of my model looks like this:</p>

<pre><code>likes:[
    { type: mongoose.Schema.ObjectId, ref: 'User'}
  ]
</code></pre>

<p>NB: if i use the pull and addtoset directly like so: {'$pull' or '$addToSet': {likes: req.user._id}} for test it works but in ternary expression like how i used above doesn't work both but only the addtoset.</p>

