Running a Heavy Scheduled MongoDB Query<p><strong>PROBLEM</strong>: I have a list of projects that have expiration times that I have to check for with a scheduler. If the project is expired, I must mark it in the database.</p>

<p>I have over 2k of project lists that are becoming heavy to run a scheduler on (With my current logic). I am using <code>node-schedule</code> as well. I have it set to 45 minutes (which isn't ideal and now it's starting to drag)</p>

<p><strong>Question</strong>: How can I optimize this scheduled job? Because I would like the expirations to happen somewhat real-time if possible. I am using <code>projects[x].activities[y].status.expired</code> and <code>projects[x].activities[y].status.startTime</code></p>

<p><strong>Schema</strong></p>

<pre><code>const StudentSchema= new Schema({
...
 projects: [
    {
      title: {
        type: String,
        required: [true, "Title is required for Project"]
      },

      activities: [
        {
          name: {
            type: String,
            required: true
          },
          gradingMechanism: {
            type: String,
            enum: ["Peer to Peer", "Mentor", "Instructor"]
          },
          totalPointsPossible: { type: Number },
          status: {
            text: {
              type: String,
              enum: [
                "Not Started",
                "Started",
                "Awaiting Grade",
                "Passing",
                "Failing"
              ],
              default: "Not Started"
            },
            graded: { type: Boolean, default: false },
            grade: { type: Number, default: 0 },
            pass: { type: Boolean, default: false },
            expired: { type: Boolean, default: false },
            completed: { type: Boolean, default: false },
            lastSave: { type: Date },
            hasStarted: { type: Boolean, default: false },
            startTime: { type: Date },
            completionTime: { type: Date }
          }
            }
          ],


        }
      ],
...

</code></pre>

<p><strong>CODE</strong></p>

<pre><code>  // Expire Activities in Projects
  schedule.scheduleJob("*/45 * * * *", async function () {
    const profile = await StudentProfile.find({});

    StudentProfile.find(
      { "projects.activities.status.expired": { $eq: false } },
      "projects"
    )
      .then((profiles) =&gt; {
        let promiseList = [];
        profiles.map((profile) =&gt; {
          const { projects } = profile;
          let saveProfile = false;

          projects.map((project, projKey) =&gt; {
            project.activities.map((activity, actKey) =&gt; {
              if (
                typeof activity.status.startTime !== "undefined" &amp;&amp;
                !activity.status.expired
              ) {
                var startTime = new Date(activity.status.startTime);
                var activityTimeout = 72;
                // If startTime+&lt;X TIME&gt; is less than or equal to current time,
                // Mark activity as expired
                if (
                  startTime.setHours(startTime.getHours() + activityTimeout) &lt;=
                  new Date()
                ) {
                  profile.projects[projKey].activities[
                    actKey
                  ].status.expired = true;
                  profile.projects[projKey].activities[actKey].status.text =
                    "Awaiting Grade";
                  saveProfile = true;
                }
              }
            });
          });
          if (saveProfile) {
            promiseList.push(profile.save());
          }
        });

        Promise.all(promiseList)
          .then((profiles) =&gt; {
            if (profiles.length &gt; 0) {
              console.log("Marked " + profiles.length + " profile's projects");
            }
          })
          .catch((err) =&gt; {
            console.error(err);
          });
      })
      .catch((err) =&gt; {
        console.error(err);
      });
  })
</code></pre>

